import { Component } from 'react';
import { Button, Input, InputLabel, MenuItem, FormControl, Select, Box } from "@material-ui/core"; 

export default class UploadForm extends Component {
  state = {
    title: "",
    level: "",
    company: ""
  };

  handleChange = (e) => {
    this.setState({ [e.target.name]: e.target.value });
}

  render() {
    return(
      <div>
        <br/>
      <Box sx={{ minWidth: 120 }}>
        <FormControl fullWidth>
          <InputLabel id="demo-simple-select-label">Job Title</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={this.state.title}
            label="Job Title"
            onChange={this.handleChange}>
            <MenuItem value={10}>Ten</MenuItem>
            <MenuItem value={20}>Twenty</MenuItem>
            <MenuItem value={30}>Thirty</MenuItem>
          </Select>
        </FormControl>
      </Box>
        <label 
          htmlFor="contained-button-file"
          name="content"
          onChange={this.handleChange}
          value={this.state.content}>
        <Input accept="image/*" id="contained-button-file" multiple type="file" />
        <Button variant="contained" component="span" onClick={this.handleSubmit}>
        Upload
        </Button>
        </label>
      </div>
    )
  }
}
